import React from "react";
import "../App.css"
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faFilter } from "@fortawesome/free-solid-svg-icons";
// import { faHome } from "@fortawesome/free-solid-svg-icons";
function HomePage() {
    return (
        <div>
            <h1 className="main-layout">Toll Management Application</h1>
            <hr/>

            <div style={{display:"flex",marginTop:"27px"}}>

                    <p className="toll-text">Toll entries/Vehicles entries </p>



                    <FontAwesomeIcon style={{marginTop:"6px",marginRight:"14"}} icon={faFilter}/>   
                  <form>
                  <input className="search-input" type="search" placeholder="Search vehicle"/>
                  </form>

                  <div style={{marginLeft:'23rem'}}>
                    <button className="add">
                        Add Vehicle entry
                    </button>
                  </div>
                  </div>






        </div>
    )
}
export default HomePage;
